class Solution:
    def maximumValueSum(self, b: List[List[int]]) -> int:
        m = len(b)
        n = len(b[0])
        maxi = b[0][0] + b[1][1] + b[2][2]
        for i in range(m):
            l = [[b[i][x], x] for x in range(n)]
            l.sort()
            b[i] = l[-3:]
        for i in range(m - 2):
            for j in range(i + 1, m - 1):
                for k in range(j + 1, m):
                    if i != j and i != k and j != k:
                        b1 = b[i]
                        b2 = b[j]
                        b3 = b[k]
                        for a in b1:
                            for s in b2:
                                for d in b3:
                                    if a[1] != s[1] and a[1] != d[1] and s[1] != d[1]:
                                        maxi = max(maxi, a[0] + s[0] + d[0])
        return maxi
